const { MongoClient } = require("mongodb");
const uri ="mongodb+srv://Vitaliy:<password>@shadowcluster.5gc07.mongodb.net/<dbname>?retryWrites=true&w=majority";
const client = new MongoClient(uri);
async function run() {
  try {
    // Connect the client to the server
    await client.connect();
